import React, {useEffect } from "react";
import "./styles.css";



export default function Home() {
    useEffect(() => {
        document.title = "Home";
      }, []);
    return (
      <div className = 'text'>
       <h2>Welcome to Charlie Yi's Website!</h2>
      </div>
    );
  }
